@-moz-document domain("produce101.jp") {
div.name a[href*="profile"],
div.name span {
    font-size: 0px;
}

div.name a[href*="profile"]:hover,
div.name a[href*="profile"]:active,
div.name a[href*="profile"]:focus {
    text-decoration: none!important;
}

div.name a[href*="profile"]:before,
div.name span:before {
    display: block;
    font-size: 14px;
    text-transform: capitalize;
    font-weight: bold;
}

div.name a[href*="profile"]:hover:before,
div.name a[href*="profile"]:active:before,
div.name a[href*="profile"]:focus:before {
    text-decoration: underline!important;
}

div.name a[href*="profile"]:after {
    display: block;
    font-weight: normal;
    font-size: 12px;
    color: #666;
    margin-top: -19px;
}

/*correct class in code*/
div.tranieeList ul li,
/*correct english spelling in case of change*/
div.traineeList ul li {
        margin-bottom: -3px;
}

div.name a[href*="profile"]:hover:after,
div.name a[href*="profile"]:active:after,
div.name a[href*="profile"]:focus:after {
    /*color: rgb(255, 80, 160);*/
